import axios from "axios";

abstract class ApiServiceAbstract {
} 

export class ApiService {
  private URL_USERS = "https://jsonplaceholder.typicode.com/users";
  private URL_POSTS = "https://jsonplaceholder.typicode.com/posts";

  async getUsers() {
    return await axios.get(this.URL_USERS);
  }

  async getPosts() {
    return await axios.get(this.URL_POSTS);
  }
}
